import {onesculp,twosculp, threesculp, foursculp} from './Sculpture';

const All = () =>{
    
    return (
        <div>
            <Gallerynav />
            {/*<button type="button" class="btn" onclick = {()=>{}}>⚙</button>*/}
        <div className="grid-container">
        
        
        <div className="grid-item">

            {onepaint} 
            <div className = "re">
                    [스핑크스]
                        <div className = "de">
                            <span className="gllbtn" onclick = {()=>{}}>⚙</span>
                        </div>
                        <br/>
                    
                    [2000-00-00]
                    
                    </div>
         </div>
         
        <div className="grid-item">
            {twopaint}
            
        </div>
        <div className="grid-item">{threepaint}
        </div>
        <div className="grid-item">{fourpaint}
        </div>
        <div className="grid-item">{onesculp}
        <div className = "re">
                    [스핑크스]
                        <div className = "de">
                            <span className="gllbtn" onclick = {()=>{}}>⚙</span>
                        </div>
                        <br/>
                    
                    [2000-00-00]
                    
                    </div>
        </div>
        <div className="grid-item">{twosculp}
        </div>
        <div className="grid-item">{threesculp}
        </div>
        <div className="grid-item">{foursculp}
        </div>
        </div>
        </div>

        
        
        
    );
    
}


export default All;
